export const Breadcrum = (props) => {
    const {product} = props;
  return (
    <div className='breadcrum'>
        HOME <ArrowUpIcon /> SHOP <ArrowUpIcon/>{product.category} <ArrowUpIcon/>{product.name}
    </div>
  )
}
